import * as React from 'react';
import { Text,TextInput,View, Image,ImageBackground, StyleSheet } from 'react-native';
import { Icon,Button,Card } from 'react-native-elements'
import { Avatar, Accessory } from 'react-native-elements';
import LoginScreen from '../components/Login';
import RegisterScreen from '../components/Register';

export default class Test extends React.Component {
  constructor(props){
    super(props)
    
   
    this.state = {
      cardstate:0
    }
}
  render() {

    return (
          <View style={styles.container}>
              <Card>
          <Button style={styles.buttonLogin} onPress={() => this.setState({ cardstate: 0})}>Holasdfads</Button>
        
          <Button style={styles.buttonRegister} onPress={() => this.setState({ cardstate: 1})}>Register</Button>
          {this.state.cardstate == 0 ? ( <LoginScreen/> ) : ( <RegisterScreen/> )}
          </Card>
            
          </View>        
        
    );
  }
}


const styles = StyleSheet.create({
  container:{
    flex:1,
    flexDirection: 'column',
    justifyContent:'center',
    alignItems: 'stretch',
  },
  buttonLogin:{
    width:'200px',
    alignSelf:'left',
    alignItems:'left'
  },
  buttonRegister:{
    width:'200px',
    alignSelf:'right',
    alignItems:'right'
  }
})
